import React, { useContext } from 'react';
import { ThemeContext } from '';

const Home = () => {
  const { theme } = useContext(ThemeContext);

  return (
    <div>
      <h1>Welcome to My App</h1>
      <p>This is the home page of the application.</p>
      <p>Theme: {theme}</p>
    </div>
  );
};

export default Home;
